postcontent:
I am putting my Springfield XD45 Tactical up for sale because I got an XDm 45. I love the XD45 Tactical but I like the XDm 45 a little more and I don't need two firearms that are so similar. The pistol comes in the original box with all of the XD gear, 2 magazines, and Talon grips applied. It is in great shape and has only about 300 rounds through it.

Make: Springfield Armory
Model: XD-45 Tactical
Cal.: 45 ACP
Action: Semi-automatic Striker-fire

Springfield Armory XD 45 ACP 5" Pistol
* Pistol w/ (2) 13rd Magazines;
* Magazine Speed Loader;
* Holster;
* Magazine Holster (holds 2 magazines);
* Original Box
